import React from "react";

import { Navbar as NavBar, Nav, Form, FormControl, Button } from "react-bootstrap";

const Navbar = () => {
  return (
    <>
      <NavBar bg="light" variant="light" >
        <NavBar.Brand href="/">FauxBnB</NavBar.Brand>
        <Nav.Link href="/posts">Places</Nav.Link>

        <Form inline style={{display: 'flex', justifyContent: 'flex-end'}}>
          <FormControl type="text" className="mr-sm-2" placeHolder='Start your search'/>
          <Button variant="outline-dark" >Search</Button>
        </Form>
      </NavBar>
    </>
  );
};



export default Navbar;
